   "source": [
    "df <- read.csv(\"/kaggle/input/formula-1-world-championship-1950-2020/lap_times.csv\")\n",
    "\n",
    "str(df)\n",
    "RacePerformance <- df\n",
    "\n",
    "danRic <- 817\n",
    "race <- 991\n",
    "\n",
    "subsetted_data <- subset(RacePerformance, driverId == danRic & raceId == race, select = milliseconds)\n",
    "\n",
    "# Create a new dataframe called 'chinaGP' with the 'milliseconds' column from 'subsetted_data'\n",
    "chinaGP <- data.frame(time = subsetted_data$milliseconds)\n",
    "\n",
    "# Convert the 'time' column to numeric\n",
    "chinaGP$time <- as.numeric(chinaGP$time)\n",
    "\n",
    "# Check the data type\n",
    "class(chinaGP$time)\n",
    "\n",
    "# Create a scatter plot\n",
    "plot(chinaGP$time, main = \"Daniel Riccardo's Lap Time for the 2018 China Grand Prix\", xlab = \"Lap\", ylab = \"Time(ms)\")\n"
   ]
