   "source": [
    "subsetted_data <- subset(RacePerformance, driverId == danRic & raceId == race, select = \"position\")\n",
    "\n",
    "# Create a new dataframe called 'chinaGP' with the 'position' column from 'subsetted_data'\n",
    "chinaGP <- data.frame(position = subsetted_data$position)\n",
    "\n",
    "# Convert the 'position' column to numeric\n",
    "chinaGP$position <- as.numeric(chinaGP$position)\n",
    "\n",
    "# Create a scatter plot\n",
    "plot(chinaGP$position, main = \"Daniel Ricciardo's Lap Position in the 2018 China Grand Prix\", xlab = \"Lap\", ylab = \"Position\")\n"
   ]
  },
